import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Card, Tab, Tabs, Table, Badge, Spinner } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import { getUserSubmissions } from '../services/api';
import { useAuth } from '../context/AuthContext';

const Profile = () => {
  const [submissions, setSubmissions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [solvedProblems, setSolvedProblems] = useState([]);
  const { user } = useAuth();

  useEffect(() => {
    const fetchUserData = async () => {
      try {
        // Fetch user's submissions
        const submissionsRes = await getUserSubmissions();
        setSubmissions(submissionsRes.data.submissions);

        // Extract unique solved problems
        const acceptedSubmissions = submissionsRes.data.submissions
          .filter(submission => submission.status === 'Accepted');

        const uniqueSolvedProblems = [];
        const problemIds = new Set();

        acceptedSubmissions.forEach(submission => {
          if (!problemIds.has(submission.problem._id)) {
            problemIds.add(submission.problem._id);
            uniqueSolvedProblems.push(submission.problem);
          }
        });

        setSolvedProblems(uniqueSolvedProblems);
      } catch (error) {
        console.error('Error fetching user data:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchUserData();
  }, []);

  const getStatusBadge = (status) => {
    let className = '';

    switch (status) {
      case 'Accepted':
        className = 'accepted';
        break;
      case 'Wrong Answer':
        className = 'wrong-answer';
        break;
      case 'Time Limit Exceeded':
        className = 'time-limit-exceeded';
        break;
      case 'Runtime Error':
      case 'Compilation Error':
        className = 'runtime-error compilation-error';
        break;
      case 'Pending':
        className = 'pending';
        break;
      default:
        className = 'pending';
    }

    return <span className={`status-badge ${className}`}>{status}</span>;
  };

  const getLanguageDisplay = (language) => {
    switch (language) {
      case 'cpp':
        return 'C++';
      case 'c':
        return 'C';
      case 'python':
        return 'Python';
      default:
        return language;
    }
  };

  if (loading) {
    return (
      <Container className="py-5 text-center">
        <Spinner animation="border" variant="primary" />
        <p className="mt-3">Loading profile...</p>
      </Container>
    );
  }

  return (
    <Container className="py-4">
      <Row className="mb-4">
        <Col>
          <Card>
            <Card.Body>
              <Row>
                <Col md={8}>
                  <h2>{user.username}</h2>
                  <p className="text-muted">{user.email}</p>
                </Col>
                <Col md={4} className="text-md-end">
                  <div className="mb-2">
                    <strong>Problems Solved:</strong> {solvedProblems.length}
                  </div>
                  <div>
                    <strong>Total Submissions:</strong> {submissions.length}
                  </div>
                </Col>
              </Row>
            </Card.Body>
          </Card>
        </Col>
      </Row>

      <Tabs defaultActiveKey="submissions" className="mb-4">
        <Tab eventKey="submissions" title="Recent Submissions">
          {submissions.length === 0 ? (
            <Card>
              <Card.Body className="text-center py-5">
                <p className="mb-3">You haven't made any submissions yet</p>
                <Link to="/problems" className="btn btn-primary">
                  Solve Problems
                </Link>
              </Card.Body>
            </Card>
          ) : (
            <Card>
              <Card.Body>
                <div className="table-responsive">
                  <Table hover>
                    <thead>
                      <tr>
                        <th>Problem</th>
                        <th>Status</th>
                        <th>Language</th>
                        <th>Time</th>
                        <th>Submitted At</th>
                      </tr>
                    </thead>
                    <tbody>
                      {submissions.slice(0, 10).map(submission => (
                        <tr
                          key={submission._id}
                          onClick={() => window.location.href = `/submissions/${submission._id}`}
                          style={{ cursor: 'pointer' }}
                        >
                          <td>
                            <Link 
                              to={`/problems/${submission.problem._id}`}
                              onClick={(e) => e.stopPropagation()}
                            >
                              {submission.problem.title}
                            </Link>
                          </td>
                          <td>{getStatusBadge(submission.status)}</td>
                          <td>{getLanguageDisplay(submission.language)}</td>
                          <td>{submission.executionTime} ms</td>
                          <td>{new Date(submission.submittedAt).toLocaleString()}</td>
                        </tr>
                      ))}
                    </tbody>
                  </Table>
                </div>
                {submissions.length > 10 && (
                  <div className="text-center mt-3">
                    <span className="text-muted">
                      Showing 10 of {submissions.length} submissions
                    </span>
                  </div>
                )}
              </Card.Body>
            </Card>
          )}
        </Tab>

        <Tab eventKey="solved" title="Solved Problems">
          {solvedProblems.length === 0 ? (
            <Card>
              <Card.Body className="text-center py-5">
                <p className="mb-3">You haven't solved any problems yet</p>
                <Link to="/problems" className="btn btn-primary">
                  Solve Problems
                </Link>
              </Card.Body>
            </Card>
          ) : (
            <Card>
              <Card.Body>
                <div className="table-responsive">
                  <Table hover>
                    <thead>
                      <tr>
                        <th>Problem</th>
                        <th>Difficulty</th>
                        <th>Tags</th>
                      </tr>
                    </thead>
                    <tbody>
                      {solvedProblems.map(problem => (
                        <tr key={problem._id}>
                          <td>
                            <Link to={`/problems/${problem._id}`}>
                              {problem.title}
                            </Link>
                          </td>
                          <td>
                            <span className={`difficulty-badge difficulty-${problem.difficulty.toLowerCase()}`}>
                              {problem.difficulty}
                            </span>
                          </td>
                          <td>
                            {problem.tags && problem.tags.map((tag, i) => (
                              <span key={i} className="problem-tag">
                                {tag}
                              </span>
                            ))}
                          </td>
                        </tr>
                      ))}
                    </tbody>
                  </Table>
                </div>
              </Card.Body>
            </Card>
          )}
        </Tab>
      </Tabs>
    </Container>
  );
};

export default Profile;
